import React from 'react';
import './navbar.css'; // Import custom CSS for styling
import { Link } from 'react-router-dom';

const Navbar=() => {
    const handleLogout=async () => {
        // Your logout logic remains unchanged
    };

    return (
        <nav className="navbar">
            <ul className="nav-list">
                <li className="nav-item">
                    <Link to="/homepage">Home</Link>
                </li>
                <li className="nav-item">
                    <Link to="/friendspost">Timeline</Link>
                </li>
                <li className="nav-item">
                    {/* Add a nested structure for Friends */}
                    <span className="nested-link">
                        Friends
                        <ul className="nested-list">
                            <li className="nested-item">
                                <Link to="/friends/myfriends">My Friends</Link>
                            </li>
                            <li className="nested-item">
                                <Link to="/friends/allusers">All Users</Link>
                            </li>
                            <li className="nested-item">
                                <Link to="/friends/receivedrequests">Received Requests</Link>
                            </li>
                        </ul>
                    </span>
                </li>
                <li className="nav-item">
                    <Link to="/about">About</Link>
                </li>
                <li className="nav-item">
                    <button onClick={handleLogout}>Logout</button>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
